import signal
import sys
import socket
import time
from datetime import datetime

online = 1
TCP_IP = '169.254.151.177'
TCP_PORT = 50010
BUFFER_SIZE = 300000

s = socket.socket()

def signal_handler(sig, frame):
    print('Closing connection...')
    close_connection()
    sys.exit(0)

def connect_to_camera():
	global s
	if not online:
		return

	# MESSAGE = str.encode("\02sRN LMDscandata\03")
	s = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
	print("Connecting...")
	s.connect((TCP_IP, TCP_PORT))

def get_data():
	data = b''
	if not online:
		hex_string = ""
		data = bytes.fromhex(hex_string)
		return data
	total_bytes = 0
	while (total_bytes < 46542-12):
		data += s.recv(BUFFER_SIZE)
		total_bytes = len(data)
	return data

def close_connection():
	if not online:
		return
	s.close()

def start(folder):
	if not folder:
		print("Must specify folder")
		return
	signal.signal(signal.SIGINT, signal_handler)
	# signal.pause()
	connect_to_camera()
	i = 0
	while True:
		print(i)
		data = get_data()

		sttime = datetime.now().strftime('%Y%m%d_%H-%M-%S.%f')
		with open(folder + '/' + sttime + '.log', 'wb') as logfile:
			logfile.write(data)
		i += 1

def read_and_process(filename):
	i = 72 - 12
	j = 0
